import {useNavigate} from 'react-router-dom';
import {nameValue} from '../component';

export const Page3 = () => {
    const naviGate = useNavigate();
    const redirectPage1 = () => {
        naviGate('/');
    };
    const escape = () => {
        window.alert('撤退は許されない...')
    };
    return (
        <>
            <div>
                <h1>隼人のお仕置き部屋</h1>
                <button onClick={redirectPage1}>最初に戻る</button>
                <button onClick={escape}></button>
            </div>
        </>
    );
};
